import React from 'react';
import '../App.css'

function Mercury() {
    return (
        <div className='planet'>
           <div className='img-div'>
           <img className='planet-img' width={300} src={require("../assets/mercury.png")}/>
           </div>

<div className='theplanet'>
            <h1>MERCURY</h1>
            <p className="overview">Mercury is the smallest planet in the Solar System and the closest to the Sun. Its orbit around the Sun takes 87.97 Earth days, the shortest of all the Sun's planets. Mercury is one of four terrestrial planets in the Solar System, and is a rocky body like Earth.</p>

            <p className="source"><a>Source: Wikipedia</a></p>

        <div className="buttons">
            <button><h3><span>01</span> OVERVIEW</h3></button>
            <button><h3><span>02</span> INTERNAL STRUCTURE</h3></button>
            <button><h3><span>03</span> SURFACE GEOLOGY</h3></button>
        </div>
        </div>
    </div>
    );
}

export default Mercury;
